import React from 'react'

function WishList(props) {
    return (
        <div>
             <thead>
                    <tr>
                        <th>Book Name</th>
                        <th>Wishlist</th>
                    </tr>
                </thead>
                <tbody>
                    {/* Wishlist */}
                    {props.info.wishlist.map((b)=>(
                        <tr>
                            <td>{getTitleFromBookId(b).title}</td>
                            <td><button onClick={()=>remFav(b)}>Unmark Wishist</button></td>
                        </tr>
                    ))}
                </tbody>
        </div>
    )
}

export default WishList
